--
-- Name: clear(); Type: FUNCTION; Schema: stemmer; Owner: -
--

CREATE FUNCTION clear() RETURNS integer
    AS $$
BEGIN
  DELETE FROM stemmer.skip;
  DELETE FROM stemmer.stem;
  
  RETURN 1;
END;
$$
    LANGUAGE plpgsql;


--
-- Name: contains_vowel(text); Type: FUNCTION; Schema: stemmer; Owner: -
--

CREATE FUNCTION contains_vowel(text) RETURNS boolean
    AS $_$
DECLARE
  word ALIAS FOR $1;
  pattern TEXT;
  ret BOOLEAN;
BEGIN
  ret := false;
  
  IF length(word)>0 THEN
    pattern := stemmer.cvc_pattern(word);
    IF position('v' in pattern)>0  THEN
      ret := true;
    END IF;
  END IF;
  
  RETURN ret;
END;
$_$
    LANGUAGE plpgsql STRICT;


--
-- Name: count_m(text); Type: FUNCTION; Schema: stemmer; Owner: -
--

CREATE FUNCTION count_m(text) RETURNS integer
    AS $_$
DECLARE
  word ALIAS FOR $1;
  pattern TEXT;
  ret INTEGER;
  i INTEGER;
  flag BOOLEAN;
BEGIN
  --initializing
  ret := 0;
  flag := false;
  i := 1;
  
  IF length(word)>0 THEN
    --find out the CVC pattern
    pattern := stemmer.cvc_pattern(word);
    --counting the number of m's...
    WHILE i<=length(pattern) LOOP
      IF (substr(pattern,i,1) = 'v') OR (flag = true) THEN
        flag := true;
        IF substr(pattern,i,1) = 'c' THEN
          ret = ret + 1;
          flag = false;
        END IF;
      END IF;
      i := i + 1;
    END LOOP;
  END IF;

  RETURN ret;
END;
$_$
    LANGUAGE plpgsql;


--
-- Name: cvc_pattern(text); Type: FUNCTION; Schema: stemmer; Owner: -
--

CREATE FUNCTION cvc_pattern(text) RETURNS text
    AS $_$
DECLARE
  word ALIAS FOR $1;
  ret TEXT;
  i INTEGER;
BEGIN
  i := 1;
  ret := '';
  
  WHILE i <= length(word) LOOP
    IF position(substr(word,i,1) in 'aeiou')>0 THEN
      ret := ret || 'v';
    ELSIF (substr(word,i,1)='y') AND (i>1) THEN
      IF position(substr(word,i-1,1) in 'aeiou')=0 THEN
        ret := ret || 'v';
      ELSE
        ret := ret || 'c';
      END IF;
    ELSE
      ret := ret || 'c';
    END IF;
    i := i + 1;
  END LOOP;
  
  RETURN ret;
END;
$_$
    LANGUAGE plpgsql STRICT;


--
-- Name: ends_cvc(text); Type: FUNCTION; Schema: stemmer; Owner: -
--

CREATE FUNCTION ends_cvc(text) RETURNS boolean
    AS $_$
--*o  - the stem ends cvc, where the second c is not W, X or Y (e.g. -WIL, -HOP).
DECLARE
  word ALIAS FOR $1;
  pattern TEXT;
  ret BOOLEAN;
BEGIN
  ret := false;

  --'check to see if atleast 3 characters are present
  IF length(word) >= 3 THEN
    -- find out the CVC pattern
	-- we need to check only the last three characters
	pattern := stemmer.right(stemmer.cvc_pattern(word),3);
	-- check to see if the letters in str match the sequence cvc
	IF pattern = 'cvc' AND position(stemmer.right(word,1) in 'wxy') = 0 THEN
      ret := true;
    END IF;
  END IF;

  RETURN ret;
END;
$_$
    LANGUAGE plpgsql STRICT;


--
-- Name: ends_double_consonant(text); Type: FUNCTION; Schema: stemmer; Owner: -
--

CREATE FUNCTION ends_double_consonant(text) RETURNS boolean
    AS $_$
--checking whether word ends with a double consonant (e.g. -TT, -SS).
DECLARE
  word ALIAS FOR $1;
  holds_ends TEXT;
  ret BOOLEAN;
  hold_third_last CHAR;
BEGIN
  ret := false;

  --first check whether the size of the word is >= 2
  IF length(word) >= 2 THEN
	-- extract 2 characters from right of str
	holds_ends := stemmer.right(word, 2);
	-- checking if both the characters are same and not double vowel
    IF substr(holds_ends,1,1) = substr(holds_ends,2,1) AND position(holds_ends in 'aaeeiioouu') = 0 THEN
      -- if the second last character is y, and there are atleast three letters in str
      IF holds_ends = 'yy' AND length(word) > 2 THEN
        -- extracting the third last character
        hold_third_last := stemmer.left(stemmer.right(word, 3),1);
        IF position(hold_third_last in 'aaeeiioouu') > 0 THEN
          ret := true;
        END IF;
   	  ELSE
        ret := true;
      END IF;
    END IF;
  END IF;

  RETURN ret;
END;
$_$
    LANGUAGE plpgsql STRICT;


