--
-- Name: left(text, integer); Type: FUNCTION; Schema: stemmer; Owner: -
--

CREATE FUNCTION "left"(text, integer) RETURNS text
    AS $_$
DECLARE
  word_in ALIAS FOR $1;
  c ALIAS FOR $2;
BEGIN
  IF (c<0) OR (c>length(word_in)) THEN
    RETURN '';
  END IF;

  RETURN substr(word_in, 1, c);
END;
$_$
    LANGUAGE plpgsql STRICT;


--
-- Name: right(text, integer); Type: FUNCTION; Schema: stemmer; Owner: -
--

CREATE FUNCTION "right"(text, integer) RETURNS text
    AS $_$
DECLARE
  word_in ALIAS FOR $1;
  c ALIAS FOR $2;
BEGIN
  IF (c<0) OR (c>length(word_in)) THEN
    RETURN '';
  END IF;
  
  RETURN substr(word_in, length(word_in)-c+1, c);
END;
$_$
    LANGUAGE plpgsql STRICT;


--
-- Name: stem(text); Type: FUNCTION; Schema: stemmer; Owner: -
--

CREATE FUNCTION stem(text) RETURNS text
    AS $_$
DECLARE
  in_word ALIAS FOR $1;
  ret TEXT;
  ret_c TEXT;
BEGIN
  ret := trim(both ' ' from in_word);
  
  -- check if in skip words list
  IF EXISTS (SELECT word FROM stemmer.skip WHERE word=ret) THEN
    RETURN ret;
  END IF;
  
  -- only strings greater than 2 are stemmed
  IF length(ret) > 2 THEN
    ret := stemmer.step1(ret);
    ret := stemmer.step2(ret);
    ret := stemmer.step3(ret);
    ret := stemmer.step4(ret);
    ret := stemmer.step5(ret);
  END IF;
  
  -- look for corrections
  SELECT INTO ret_c stem FROM stemmer.stem WHERE word = ret;
  
  IF ret_c IS NOT NULL THEN RETURN ret_c; END IF;
  
  RETURN ret;
END;
$_$
    LANGUAGE plpgsql STRICT;


--
-- Name: step1(text); Type: FUNCTION; Schema: stemmer; Owner: -
--

CREATE FUNCTION step1(text) RETURNS text
    AS $_$
DECLARE
  in_word ALIAS FOR $1;
  occ RECORD;
  ret TEXT;
  
  m INTEGER;
  temp TEXT;
  second_third_success BOOLEAN;
BEGIN
  ret := in_word;
/* STEP 1A *********************************************************************

    SSES -> SS                         caresses  ->  caress
    IES  -> I                          ponies    ->  poni
                                       ties      ->  ti
    SS   -> SS                         caress    ->  caress
    S    ->                            cats      ->  cat
*******************************************************************************/
  FOR occ IN
    SELECT phrase_from, phrase_to
    FROM stemmer.porter
    WHERE step = 1 AND
      stemmer.right(ret,length(phrase_from)) = phrase_from
    ORDER BY seq
  LOOP
    ret := stemmer.left(ret, length(ret) - length(occ.phrase_from)) || occ.phrase_to;
    EXIT;
  END LOOP;
/******************************************************************************/
--STEP 1B
--
--   If
--       (m>0) EED -> EE                     feed      ->  feed
--                                           agreed    ->  agree
--   Else
--       (*v*) ED  ->                        plastered ->  plaster
--                                           bled      ->  bled
--       (*v*) ING ->                        motoring  ->  motor
--                                           sing      ->  sing
--
--If the second or third of the rules in Step 1b is successful, the following
--is done:
--
--    AT -> ATE                       conflat(ed)  ->  conflate
--    BL -> BLE                       troubl(ed)   ->  trouble
--    IZ -> IZE                       siz(ed)      ->  size
--    (*d and not (*L or *S or *Z))
--       -> single letter
--                                    hopp(ing)    ->  hop
--                                    tann(ed)     ->  tan
--                                    fall(ing)    ->  fall
--                                    hiss(ing)    ->  hiss
--                                    fizz(ed)     ->  fizz
--    (m=1 and *o) -> E               fail(ing)    ->  fail
--                                    fil(ing)     ->  file
--
--The rule to map to a single letter causes the removal of one of the double
--letter pair. The -E is put back on -AT, -BL and -IZ, so that the suffixes
---ATE, -BLE and -IZE can be recognised later. This E may be removed in step
--4.
/******************************************************************************/
  --initializing
  second_third_success := false;
  --(m>0) EED -> EE..else..(*v*) ED  ->(*v*) ING  ->
  
  IF (stemmer.right(ret,length('eed'))='eed') THEN
    --counting the number of m--s
	temp := stemmer.left(ret, length(ret) - length('eed'));
    m := stemmer.count_m(temp);
    IF m > 0 THEN
      ret := stemmer.left(ret, length(ret) - length('eed')) || 'ee';
    END IF;
  ELSIF stemmer.right(ret,length('ed')) = 'ed' THEN
    --trim and check for vowel
    temp := stemmer.left(ret, length(ret) - length('ed'));
    IF stemmer.contains_vowel(temp) THEN
      ret := stemmer.left(ret, length(ret) - length('ed'));
      second_third_success := true;
    END IF;
  ELSIF stemmer.right(ret,length('ing')) = 'ing' THEN
    --trim and check for vowel
    temp := stemmer.left(ret, length(ret) - length('ing'));
    IF stemmer.contains_vowel(temp) THEN
      ret := stemmer.left(ret, length(ret) - length('ing'));
      second_third_success := true;
    END IF;
  END IF;
  

--If the second or third of the rules in Step 1b is SUCCESSFUL, the following
--is done:
--
--    AT -> ATE                       conflat(ed)  ->  conflate
--    BL -> BLE                       troubl(ed)   ->  trouble
--    IZ -> IZE                       siz(ed)      ->  size
--    (*d and not (*L or *S or *Z))
--       -> single letter
--                                    hopp(ing)    ->  hop
--                                    tann(ed)     ->  tan
--                                    fall(ing)    ->  fall
--                                    hiss(ing)    ->  hiss
--                                    fizz(ed)     ->  fizz
--    (m=1 and *o) -> E               fail(ing)    ->  fail
--                                    fil(ing)     ->  file


  IF second_third_success THEN  -- If the second or third of the rules in Step 1b is SUCCESSFUL
    IF stemmer.right(ret,length('at')) = 'at' THEN    --AT -> ATE
      ret := stemmer.left(ret,length(ret) - length('at')) || 'ate';
   	ELSIF stemmer.right(ret,length('bl')) = 'bl' THEN --BL -> BLE
      ret := stemmer.left(ret,length(ret) - length('bl')) || 'ble';
    ELSIF stemmer.right(ret,length('iz')) = 'iz' THEN --IZ -> IZE
      ret := stemmer.left(ret,length(ret) - length('iz')) || 'ize';
    ELSIF stemmer.ends_double_consonant(ret) THEN  /*(*d and not (*L or *S or *Z))-> single letter*/
      IF position(stemmer.right(ret,1) IN 'lsz') = 0 THEN
        ret := stemmer.left(ret, length(ret) - 1);
      END IF;
	ELSIF stemmer.count_m(ret) = 1 THEN  /*(m=1 and *o) -> E */
      IF stemmer.ends_double_cvc(ret) THEN
        ret := ret || 'e';
      END IF;
    END IF;
  END IF;
/******************************************************************************/
--
--STEP 1C
--
--    (*v*) Y -> I                    happy        ->  happi
--                                    sky          ->  sky
/******************************************************************************/
  IF stemmer.right(ret,LENGTH('y')) = 'y' THEN
    -- trim and check for vowel
    temp := stemmer.left(ret,length(ret)-1);
    IF stemmer.contains_vowel(temp) THEN
      ret := stemmer.left(ret, length(ret) - 1) || 'i';
    END IF;
  END IF;
/******************************************************************************/
  RETURN ret;
END;
$_$
    LANGUAGE plpgsql STRICT;


--
-- Name: step2(text); Type: FUNCTION; Schema: stemmer; Owner: -
--

CREATE FUNCTION step2(text) RETURNS text
    AS $_$
/*STEP 2

    (m>0) ATIONAL ->  ATE           relational     ->  relate
    (m>0) TIONAL  ->  TION          conditional    ->  condition
                                    rational       ->  rational
    (m>0) ENCI    ->  ENCE          valenci        ->  valence
    (m>0) ANCI    ->  ANCE          hesitanci      ->  hesitance
    (m>0) IZER    ->  IZE           digitizer      ->  digitize
Also,
    (m>0) BLI    ->   BLE           conformabli    ->  conformable

    (m>0) ALLI    ->  AL            radicalli      ->  radical
    (m>0) ENTLI   ->  ENT           differentli    ->  different
    (m>0) ELI     ->  E             vileli        - >  vile
    (m>0) OUSLI   ->  OUS           analogousli    ->  analogous
    (m>0) IZATION ->  IZE           vietnamization ->  vietnamize
    (m>0) ATION   ->  ATE           predication    ->  predicate
    (m>0) ATOR    ->  ATE           operator       ->  operate
    (m>0) ALISM   ->  AL            feudalism      ->  feudal
    (m>0) IVENESS ->  IVE           decisiveness   ->  decisive
    (m>0) FULNESS ->  FUL           hopefulness    ->  hopeful
    (m>0) OUSNESS ->  OUS           callousness    ->  callous
    (m>0) ALITI   ->  AL            formaliti      ->  formal
    (m>0) IVITI   ->  IVE           sensitiviti    ->  sensitive
    (m>0) BILITI  ->  BLE           sensibiliti    ->  sensible
Also,
    (m>0) LOGI    ->  LOG           apologi        -> apolog
*/
DECLARE
  in_word ALIAS FOR $1;
  occ RECORD;
  ret TEXT;
  temp TEXT;
BEGIN
  --checking word
  ret := in_word;
  
  FOR occ IN
    SELECT phrase_from, phrase_to
    FROM stemmer.porter
    WHERE step = 2 AND
      stemmer.right(ret,length(phrase_from)) = phrase_from
    ORDER BY seq
  LOOP
    temp := stemmer.left(ret, length(ret) - length(occ.phrase_from));
    IF stemmer.count_m(temp) > 0 THEN
      ret := stemmer.left(ret, length(ret) - length(occ.phrase_from)) || occ.phrase_to;
      EXIT;
    END IF;
  END LOOP;

  --retuning the word
  RETURN ret;
END;
$_$
    LANGUAGE plpgsql STRICT;


--
-- Name: step3(text); Type: FUNCTION; Schema: stemmer; Owner: -
--

CREATE FUNCTION step3(text) RETURNS text
    AS $_$
/*STEP 3
    (m>0) ICATE ->  IC              triplicate     ->  triplic
    (m>0) ATIVE ->                  formative      ->  form
    (m>0) ALIZE ->  AL              formalize      ->  formal
    (m>0) ICITI ->  IC              electriciti    ->  electric
    (m>0) ICAL  ->  IC              electrical     ->  electric
    (m>0) FUL   ->                  hopeful        ->  hope
    (m>0) NESS  ->                  goodness       ->  good
*/
DECLARE
  in_word ALIAS FOR $1;
  occ RECORD;
  ret TEXT;
  temp TEXT;
  i INTEGER;
BEGIN
  --checking word
  ret := in_word;
  
  FOR occ IN
    SELECT phrase_from, phrase_to
    FROM stemmer.porter
    WHERE step = 3 AND
      stemmer.right(ret,length(phrase_from)) = phrase_from
    ORDER BY seq
  LOOP
    temp := stemmer.left(ret,length(ret) - length(occ.phrase_from));
    IF stemmer.count_m(temp) > 0 THEN
      ret := stemmer.left(ret,length(ret) - length(occ.phrase_from)) || occ.phrase_to;
      EXIT;
    END IF;
  END LOOP;

  --retuning the word
  RETURN ret;
END;
$_$
    LANGUAGE plpgsql STRICT;


--
-- Name: step4(text); Type: FUNCTION; Schema: stemmer; Owner: -
--

CREATE FUNCTION step4(text) RETURNS text
    AS $_$
--STEP 4
--
--    (m>1) AL    ->                  revival        ->  reviv
--    (m>1) ANCE  ->                  allowance      ->  allow
--    (m>1) ENCE  ->                  inference      ->  infer
--    (m>1) ER    ->                  airliner       ->  airlin
--    (m>1) IC    ->                  gyroscopic     ->  gyroscop
--    (m>1) ABLE  ->                  adjustable     ->  adjust
--    (m>1) IBLE  ->                  defensible     ->  defens
--    (m>1) ANT   ->                  irritant       ->  irrit
--    (m>1) EMENT ->                  replacement    ->  replac
--    (m>1) MENT  ->                  adjustment     ->  adjust
--    (m>1) ENT   ->                  dependent      ->  depend
--    (m>1 and (*S or *T)) ION ->     adoption       ->  adopt
--    (m>1) OU    ->                  homologou      ->  homolog
--    (m>1) ISM   ->                  communism      ->  commun
--    (m>1) ATE   ->                  activate       ->  activ
--    (m>1) ITI   ->                  angulariti     ->  angular
--    (m>1) OUS   ->                  homologous     ->  homolog
--    (m>1) IVE   ->                  effective      ->  effect
--    (m>1) IZE   ->                  bowdlerize     ->  bowdler
--
--The suffixes are now removed. All that remains is a little tidying up.
DECLARE
  in_word ALIAS FOR $1;
  occ RECORD;
  ret TEXT;
  temp TEXT;
BEGIN
  --checking word
  ret := in_word;

  FOR occ IN
    SELECT phrase_from
    FROM stemmer.porter
    WHERE step = 4 AND
      stemmer.right(ret,length(phrase_from)) = phrase_from
    ORDER BY seq
  LOOP
    temp := stemmer.left(ret, length(ret) - length(occ.phrase_from));
    IF stemmer.count_m(temp) > 1 THEN
      IF stemmer.right(ret,length('ion')) = 'ion' THEN
        IF stemmer.right(temp,1) = 's' OR stemmer.right(temp,1) = 't' THEN
          ret := stemmer.left(ret, length(ret) - length(occ.phrase_from));
        END IF;
      ELSE
        ret := stemmer.left(ret,length(ret) - length(occ.phrase_from));
      END IF;
    END IF;
    EXIT;
  END LOOP;

  --retuning the word
  RETURN ret;
END;
$_$
    LANGUAGE plpgsql STRICT;


--
-- Name: step5(text); Type: FUNCTION; Schema: stemmer; Owner: -
--

CREATE FUNCTION step5(text) RETURNS text
    AS $_$
--STEP 5a
--
--    (m>1) E     ->                  probate        ->  probat
--                                    rate           ->  rate
--    (m=1 and not *o) E ->           cease          ->  ceas
--
--STEP 5b
--
--    (m>1 and *d and *L) -> single letter
--                                    controll       ->  control
--                                    roll           ->  roll
/******************************************************************************/
--STEP 5a
DECLARE
  in_word ALIAS FOR $1;
  occ RECORD;
  ret TEXT;
  temp TEXT;
  m INTEGER;
BEGIN
  ret := in_word;
  --Step5a
  IF stemmer.right(ret,1) = 'e' THEN --word ends with e
    temp := stemmer.left(ret,length(ret) - 1);
    m := stemmer.count_m(temp);
    IF m > 1 THEN
      ret := stemmer.left(ret,length(ret) - 1);
    ELSIF m = 1 THEN
      IF NOT stemmer.ends_cvc(temp) THEN
        ret := stemmer.left(ret, length(ret) - 1);
      END IF;
	END IF;
  END IF;
/******************************************************************************/
--STEP 5b
  IF stemmer.count_m(ret) > 1 THEN
    IF stemmer.ends_double_consonant(ret) AND stemmer.right(ret,1) = 'l' THEN
      ret := stemmer.left(ret,length(ret) - 1);
    END IF;
  END IF;

  --retuning the word
  RETURN ret;
END;
$_$
    LANGUAGE plpgsql STRICT;


--
-- Name: test(); Type: FUNCTION; Schema: stemmer; Owner: -
--

CREATE FUNCTION test() RETURNS integer
    AS $$
-- return number of mistakes from test collection
DECLARE
  ret INTEGER;
BEGIN
  UPDATE stemmer.test SET test = stemmer.stem(word);
  
  SELECT INTO ret count(*)
  FROM stemmer.test
  WHERE stem!=test;
  
  RETURN ret;
END;
$$
    LANGUAGE plpgsql;


